import React, { useState } from 'react';
import axios from 'axios';
import '../css/ConsultaImovel.css';
import logo from '../img/logo.png';
import { useNavigate } from 'react-router-dom';

function ConsultaImovel() {
  const navigate = useNavigate();

  const [cep, setCep] = useState('');
  const [endereco, setEndereco] = useState('');

  const handleCepChange = (event) => {
    setCep(event.target.value);
  };

  const buscarEndereco = () => {
    axios
      .get(`https://viacep.com.br/ws/${cep}/json/`)
      .then((response) => {
        const { logradouro, bairro, localidade, uf } = response.data;
        const enderecoCompleto = `${logradouro}, ${bairro}, ${localidade} - ${uf}`;
        setEndereco(enderecoCompleto);
      })
      .catch((error) => {
        console.log(error);
        setEndereco('Endereço não encontrado');
      });
  };

  const handleRowClick = (index) => {
    setSelectedRow(index);
  };

  const verImoClick = () => {
    navigate('/component/VisualizarImovel.js');
  };

  const rows = [
    { ufCidade: 'PR - Curitiba', bairro: 'Uberaba', tipo: 'Casa', valor: 'R$800.00' },
    { ufCidade: 'PR - Curitiba', bairro: 'Prado Velho', tipo: 'Apto.', valor: 'R$1200.00' },
    { ufCidade: '', bairro: '', tipo: '', valor: '' },
    { ufCidade: '', bairro: '', tipo: '', valor: '' },
  ];

  return (
    <div className="ConsultaImovel">
      <header className="ConsultaImovel-header">
        <table>
          <tbody>
            <tr>
              <td colSpan="0">
                <img src={logo} className="rentfyLogoConsultaImovel" alt="logo" />
              </td>
            </tr>
            <tr>
              <td colSpan="0">Consulte suas Reservas</td>
            </tr>
            <tr>
              <td>
                <p>Imóveis Localizados</p>
                <br />
                <div>
                  <label htmlFor="cepInput">CEP:</label>
                  <input type="text" id="cepInput" value={cep} onChange={handleCepChange} />
                  <button onClick={buscarEndereco}>Buscar</button>
                </div>
                <div>
                  <label htmlFor="enderecoInput">Endereço:</label>
                  <input type="text" id="enderecoInput" value={endereco} readOnly />
                </div>
                <br />
                <table id="imoveis-localizados" className="table-bordered" style={{ fontSize: '16px' }}>
                  <thead>
                    <tr>
                      <th>UF - Cidade</th>
                      <th>Bairro</th>
                      <th>Tipo</th>
                      <th>Valor</th>
                    </tr>
                  </thead>
                  <tbody>
                    {rows.map((row, index) => (
                      <tr
                        key={index}
                        onClick={() => handleRowClick(index)}
                        style={{ backgroundColor: selectedRow === index ? 'lightblue' : '' }}
                      >
                        <td>{row.ufCidade}</td>
                        <td>{row.bairro}</td>
                        <td>{row.tipo}</td>
                        <td>{row.valor}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
                <br />
                <button className="btnCadastrarImovel" onClick={verImoClick}>
                  Visualizar Imóvel
                </button>
              </td>
            </tr>
          </tbody>
        </table>
      </header>
    </div>
  );
}

export default ConsultaImovel;
